import React from 'react';
import { useStore } from './store';

export const SubmitButton = () => {
    const getNodeCount = useStore(state => state.getNodeCount);
    const getEdgeCount = useStore(state => state.getEdgeCount);

    const handleSubmit = () => {
        const nodeCount = getNodeCount();
        const edgeCount = getEdgeCount();
        
        console.log(`Nodes: ${nodeCount}, Edges: ${edgeCount}`);
        // Perform the submit action here, e.g., make an API call
    };

    return (
        <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
            <button type="button" onClick={handleSubmit}>
                Submit
            </button>
        </div>
    );
};
